Pebble.addEventListener('showConfiguration', function(e) {
	var claySettings = JSON.parse(localStorage.getItem("clay-settings"));
	for (var key in claySettings) {
		if (claySettings.hasOwnProperty(key)) {
			if(key in options){
				//console.log(key + " -> " + options[key]);
				claySettings[key] = options[key];
		}
	}
}	
	localStorage["clay-settings"] = JSON.stringify(claySettings);
  Pebble.openURL(clay.generateUrl());
	console.log("configuration shown");
});

Pebble.addEventListener('webviewclosed', function(e) {
  if (e && !e.response) {
    return;
  }
  var dict = clay.getSettings(e.response);
		
  // Save the Clay settings to the Settings module. 
  Settings.option(dict);
	options = Settings.option();
	console.log(JSON.stringify(options));
	setSettings();
});

function setSettings(){
	sailing.shiftAlert = options.shiftAlert;
	sailing.showShiftAlert = options.showShiftAlert;
	sailing.navigation = options.navigation;
	sailing.markAlert = options.markAlert;
	sailing.tackAlert = options.tackAlert;
	sailing.laylineAlert = options.laylineAlert;
	console.log("bowOffset setting"+options.bowOffset);
	if(!isNaN(options.bowOffset))line.bowOffset = Math.ceil(Math.cos(45*0.017453)*options.bowOffset);
	
	if(Settings.data('user_id')!==undefined){
		ajax({ url: 'http://pieteroskam.nl/regattaWinner/api.php?q=update_user&user_id='+Settings.data('user_id'),data:options,method:'post'},function(data){
			console.log("API update user: "+data);
		});
	}
	
	
	console.log("settings set");
	
}
