var timerInterval = 0;
var start = {};

function updateTimer(){
  
	updateTimerWindow();
	var seconds = timer.timeLeft().seconds;
	if(seconds%60===0)vibrate("long");
	if(seconds<=10&&seconds>5)vibrate("double");
	if(seconds<=5&& seconds>0)vibrate("short");
	
	if(timer.timeLeft().text==="racing"){
    console.log("Start race");
    sailingWindow.show();
    sailing.racing = 1;
    clearInterval(timerInterval);
    var distance = line.distanceToStart(position);
		
		
		//Check if a distance could be calculated
		if(!isNaN(distance)){
			if(distance>=0&&options.clearStartAlert){
				showAlert({title:"CLEAR",text:distance+"m",timeout:30000, timestamp:position.timestamp});
			} else if(options.ocsAlert) {
					showAlert({title:"OCS",text:distance+"m",timeout:30000, timestamp:position.timestamp});
					vibrate("long",10);
			}
		}
		
		start = {			
				startTime:timer.startTime,		
				timestamp:position.timestamp,
				distanceToStart:distance,
				speed:position.speed,
				//position:position,
				RCB:line.RCB,
				PIN:line.PIN,
			};	

	}
  
}

function timerStart(){
    timer.start();
    timerInterval = setInterval(updateTimer, 1000);
  
}

function timerUp(){
	timer.up();
}
function timerDown() {
  timer.down();
}

function timerSync(){
  timer.sync();
  clearInterval(timerInterval);
  updateTimerWindow();
  timerInterval = setInterval(updateTimer, 1000);
}

function timerReset() {
  
  timer.reset();
  clearInterval(timerInterval);
  sailing.racing = 0;
	if(sailing.TWD>=0){
		sailing.referenceWind = sailing.TWD;
	}
  //sailing.TWD = -1;
  //sailing.upwindMarks = [];
  //sailsailing.downwindMarks = [];
	
	sailing.upwindSpeed=0;
	sailing.upwindPoints=0;
	sailing.downwindSpeed=0;
	sailing.downwindPoints=0;
	
	updateTimerWindow();
	
	//uploadRace();//Upload the track
}


